import * as types from "./types";

export const setCompList = () => ({
    type: types.SET_COMP_LIST
})

export const setCompListSucceed = () => ({
    type: types.SET_COMP_LIST_SUCCEED
})

export const setCompListFailed = () => ({
    type: types.SET_COMP_LIST_FAILED
})
